import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Box,
  Button,
  IconButton,
  Avatar,
  Card,
  CardContent,
  Grid,
  useTheme,
  useMediaQuery,
  CircularProgress,
  Badge
} from '@mui/material';
import {
  FastfoodOutlined as FoodIcon,
  CheckCircleOutline as AcceptedIcon,
  SearchOutlined as SearchIcon,
  BarChartOutlined as StatsIcon,
  ExitToApp as LogoutIcon,
  NotificationsOutlined as NotificationIcon
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { logout } from '../../services/auth.service';
import { getAcceptedDonations, getAvailableDonations } from '../../services/donation.service';

const ReceiverDashboard = () => {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const user = JSON.parse(localStorage.getItem('user'));

  const [stats, setStats] = useState({
    acceptedDonations: 0,
    availableDonations: 0,
    totalMeals: 0,
    recentDonations: []
  });
  const [loading, setLoading] = useState(true);
  const [availableDonationCount, setAvailableDonationCount] = useState(0);

  useEffect(() => {
    fetchStats();
    fetchAvailableDonations();
  }, []);

  const fetchStats = async () => {
    try {
      const donations = await getAcceptedDonations();
      const totalMeals = donations.reduce((acc, curr) => acc + (curr.mealCount || 0), 0);
      setStats({
        acceptedDonations: donations.length,
        totalMeals,
        recentDonations: donations.slice(0, 5)
      });
    } catch (error) {
      console.error('Error fetching stats:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchAvailableDonations = async () => {
    try {
      const availableDonations = await getAvailableDonations();
      setAvailableDonationCount(availableDonations.length);
    } catch (error) {
      console.error('Error fetching available donations:', error);
    }
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (loading) {
    return (
      <Box 
        component="main"
        sx={{ 
          display: 'flex', 
          justifyContent: 'center', 
          alignItems: 'center', 
          minHeight: '100vh' 
        }}
        role="main"
        aria-label="Loading dashboard"
      >
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box 
      component="main"
      sx={{ 
        bgcolor: '#F5F5F5', 
        minHeight: '100vh' 
      }}
      role="main"
    >
      {/* Header */}
      <Box 
        component="header"
        sx={{ 
          bgcolor: 'white', 
          boxShadow: '0 2px 10px rgba(0,0,0,0.08)',
          mb: 3
        }}
      >
        <Container maxWidth="lg">
          <Box 
            sx={{ 
              py: 2,
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'space-between'
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
              <Avatar 
                sx={{ 
                  bgcolor: '#2196F3',
                  width: 50,
                  height: 50
                }}
                alt={user?.name || 'User'}
              >
                {user?.name?.charAt(0) || 'R'}
              </Avatar>
              <Box>
                <Typography variant="h6" component="h1">
                  Welcome back, {user?.name || 'Receiver'}!
                </Typography>
                <Typography variant="body2" color="text.secondary" component="p">
                  {user?.organizationType?.charAt(0).toUpperCase() + user?.organizationType?.slice(1) || 'Food Receiver'}
                </Typography>
              </Box>
            </Box>

            <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
              <IconButton aria-label="Notifications" onClick={() => navigate('/receiver/available')}>
                <Badge badgeContent={availableDonationCount} color="error">
                  <NotificationIcon />
                </Badge>
              </IconButton>
              <Button
                variant="outlined"
                color="error"
                startIcon={<LogoutIcon />}
                onClick={handleLogout}
                aria-label="Logout"
              >
                Logout
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>
    </Box>
  );
};

export default ReceiverDashboard;
